import React, { useState } from "react";
import './Styles/App.css'
import Box9x9 from "./Components/Box9x9/Box9x9";

function App() {
  let [number, setNumber] = useState(0);
  //Меняет цвет блока, переключая его при ходе.
  function changeColor(sid){
    var elem = document.getElementById(sid);
    var typecolor = '';
    console.log(sid, elem)
    setNumber(number++);
    if (number % 2 === 0 && typecolor != ('Red' || 'Blue')){
      typecolor = 'Red';
    }
    else{
      typecolor = 'Blue';
    }
    elem.style.backgroundColor = typecolor;
  }
  return (
    <div className="App" >
      <Box9x9 getId={changeColor}/>
    </div>
  );
}

export default App;
